from libs import emoji_check
import numpy as np

def get_polarity(emojistrs):
    emojis = emojistrs.split(',')
    total = 0
    n_emoji=0
    sig_p=0
    sig_n=0
    for e in emojis:
        n,nu,p,sc=emoji_check.check_value(e)
        if(n!=None and nu != None and p!= None and sc !=None):
            # print(e, n,nu,p,sc)
            n_emoji+=1
            total+=sc
            sig_p+=p
            sig_n+=n
            
        # else:
            # print(e)
    # y = (total*1.0)/n_emoji if n_emoji!=0 else 0.5
    y = (((sig_p-sig_n)/n_emoji)-(-1))/(1-(-1)) if n_emoji!=0 else 0.5
    # print(y)
    return y

def predict_emoji_sentiment(X_test_emojis):
    preds=[]
    for d in X_test_emojis:
        pol = get_polarity(d)
        preds.append(pol)
    return preds



